import React from 'react'
import TableDataRow from './TableDataRow'

export default function TableData() {
    const renderTodos = currentTodos.map((value, index) => {
        return <TableDataRow
            key={index}
            user={value}
        />;
    });
    return (
        <div className="col">
            <table className="table table-striped">
                <thead><tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Role</th>
                    <th>Created</th>
                    <th>Update</th>
                    <th>Action</th>
                </tr>
                </thead>
                <tbody>
                    {renderTodos}
                </tbody>
            </table>
        </div>
    )
}
